import { Sidebar } from './components/Sidebar';

function App() {
  return (
  <div sx={{backgroundColor:"cyan"}} >
    <Navbar/>


     <Sidebar/>
     <Rightbar/>
     <Feed/>
    </div>
  );
}

export default App;
